function preview() {
    var banner_width;
    if (navigator.userAgent.match(/(iPhone|iPod|Android.*Mobile)/i)) {
        banner_width = 80;
    } else {
        banner_width = 40;
    }
    document.write(
        '<link rel="stylesheet" href="https://bitlinker.usay05.com/ad/banner.css">'
    );
    document.write('<div class="bitlinker_ad" id="bitlinker_ad">');
    document.write(
        '<img id="bitlinker_banner_img" src="https://bitlinker.usay05.com/ad/730x90.png" alt="BitLinker Ad" style="width: ' +
        banner_width +
        '%" alt="[BitLinker Ad]" onclick="bitlinker_push_ad();">'
    );
    document.write("</div>");
}
const lazyLoadSet = function () {
    let data = new Array();
    const imgs = document.getElementsById("bitlinker_banner_img");
    for (let i = 0, n = imgs.length; i < n; i++) {
        data.push({ URL: imgs[i].src, selector: imgs[i] });
        imgs[i].src =
            "data:image/png;base64,";
    }
    window.addEventListener(
        "load",
        function () {
            data = lazyLoadRun(data, 750);
            let timerID = null;
            window.addEventListener(
                "scroll",
                function () {
                    if (!timerID) {
                        timerID = setTimeout(function () {
                            timerID = null;
                            data = lazyLoadRun(data, 500);
                            if (data.length < 1) {
                                timerID = true;
                            }
                            console.log(data.length);
                        }, 200);
                    }
                },
                false
            );
        },
        false
    );
    const lazyLoadRun = function ($data, $pre) {
        const returnArr = new Array();
        const windowHeight = document.documentElement.clientHeight;
        for (let j = 0, m = $data.length; j < m; j++) {
            if ($data[j].selector.getBoundingClientRect().top < windowHeight + $pre) {
                $data[j].selector.src = $data[j].URL;
            } else {
                returnArr.push($data[j]);
            }
        }
        return returnArr;
    };
};
window.addEventListener("DOMContentLoaded", lazyLoadSet, false);
preview();

var host = window.location.host;

function bitlinker_push_ad() {
    window.open("https://bitlinker.usay05.com/?adsense_from=" + host, "_blank");
}
